//functions
//*****************************************1)function selecting the dict****returns the array of object i.e. dict
function selectDict(branchVariable){
    switch(branchVariable){
        case 'civil':
            return civil;
        case 'comp':
            return comp;
        case 'entc':
            return entc;
        case 'mech':
            return mech;
        case 'ele':
            return ele;
    }
}

//*************************2)sort by districts to dict (returns array of object i.e. dict)
function sortBydistrict(objdict,firstDist,secondDist,thirdDist){
    let newdict = []
    if (firstDist === "all"||secondDist=== "all"||thirdDist=== "all"){
        newdict = objdict
    }else{
        for(let i =0; i < objdict.length;i++){
            if (objdict[i]['dist'] === firstDist||objdict[i]['dist'] ===secondDist||objdict[i]['dist'] ===thirdDist){
                newdict.push(objdict[i])
            }
        }   
    }
    
    return newdict
}
//***********************this function will produce dict with new proper cutoff accepts the input
//***************************this funtion will give you othercutoff and homecutoff for function addcutoff in form of list like [homecutoff,othercutoff]
//
//most important h_or_o do not decides the home or otherthan home it just gives other than home 
function h_or_o(gender,cat){
    const combinetext =gender+cat
    console.log(combinetext)
    let homecutoff = ""
    let othercutoff = "" 
    switch(combinetext){
        case "maleopen":
            homecutoff=1;
            othercutoff=9;
            break;
        case 'maleobc':
            homecutoff=2;
            othercutoff=10
            break;
        case 'malesc':
            homecutoff=3;
            othercutoff=11
            break;
        case 'malest':
            homecutoff=4;
            othercutoff=12;
            break;
        case 'femaleopen':
            homecutoff=5;
            othercutoff=13;
            break;
        case 'femaleobc':
            homecutoff=6;
            othercutoff=14;
            break;
        case 'femalesc':
            homecutoff=7;
            othercutoff=15;
            break;
        case 'femalest':
            homecutoff=8;
            othercutoff=16;
            break;
        default:
            break

    }
    console.log(homecutoff,othercutoff,gender)
    return([homecutoff,othercutoff])
    
}

//fuction for producing final dict with new properety cutoff(return array of object i.e.dict)
function addCutoff(dict,district,othercutoff,homecutoff){
    for (let i = 0; i < (dict.length); i++) {
        
        const firstValue = Object.values(dict)[i];
        //store the element in object array
        
        const secondVal = Object.values(firstValue)[17];
        //store the 17th property of object i.e.dist
        //here district is consider to be home district 

        if(secondVal==district){
        // changeindex=i;
        firstValue.cutoff=Object.values(firstValue)[homecutoff]
        //homecutoff should be a index position of homedistrictcutoff of that category
        //eg category is open and gender in male so category becomes gopen
        }
        else {
            firstValue.cutoff=Object.values(firstValue)[othercutoff]
        }
    }
    return dict
}
//arrange dict into discending order of your cutoff 
function arrangeIndiscending(dict){
    dict.sort((a, b) => {
        
        return b.cutoff - a.cutoff;
   
    });
    return dict
    
}
//3)catlist produce returnslist
function produceCatlist(dict){
            const catlist = dict.map(({cutoff})=>cutoff);
            return catlist
            
    }

//nearest number function for array returns index of nearest number in array
function nearest_number(arr,inputnum){
    let checklist=[]
    function addtolist(item){
       const b= Math.abs(item-inputnum)
        checklist.push(b)
    }
    arr.forEach(addtolist)
        const d=checklist.indexOf(Math.min(...checklist))
        return d
}

