function produceDtecodes(dict, index) {
    let finalList = [];
    if (dict.length < 15) {
      return dict.map((college) => college.dte);
    } else {
      if (index + 7 > dict.length) {
        for (let i = dict.lenght - 14; i < dict.lenght - 1; i++) {
          finalList.push(dict[i].dte);
        }
      } else if (index - 7 < 1) {
        for (let i = 0; i < 14; i++) {
          finalList.push(dict[i].dte);
        }
      } else {
        for (let i = index - 7; i < index + 7; i++) {
          finalList.push(dict[i].dte);
        }
      }
      return finalList;
    }
  }


function cet_give_final_dict(cat,gender,percentile,owndistrict,district1,district2,district3,branch){
    const dict1=selectDict(branch)
    const dict2=sortBydistrict(dict1,district1,district2,district3)
    const homec=h_or_o(gender,cat)[0]
    const othhomec=h_or_o(gender,cat)[1]
    const dict3=addCutoff(dict2,owndistrict,othhomec,homec)
    const dict4=arrangeIndiscending(dict3)
    const list1=produceCatlist(dict4)
    const near_index=nearest_number(list1,percentile)
    const list2=produceDtecodes(dict4,near_index)
    const dictfinal=[]
    list2.forEach(element => {
      let cutoffarrayobj=dict4.find(item => item.dte===element)
      let cutoffval=cutoffarrayobj.cutoff

      var addd = {
        dte:element,
        name:namedict[element].name,
        dist:namedict[element].dist,
        cutoff:cutoffval,
        web_address:webdict[`${element}`]
      }
      dictfinal.push(addd)
      
    });
    return dictfinal
}


