function getRndInteger(min, max) {
    return Math.floor(Math.random() * (max - min) ) + min;
  }
function predictor(dte,branchdict,input_percentile){
    var dte1=parseInt(dte)
    var resultobject2 = branchdict.filter(obj => {
        return obj['dte'] === dte1
      })
      console.log(`this is ${resultobject2}`)
      
    var gopenh_cutoff=resultobject2[0]["gopenh"]
    var chance_percentage=((input_percentile/gopenh_cutoff)*100)

    if (chance_percentage>100){
        chance_percentage = 99
    }else if (50<chance_percentage<85){
        chance_percentage = getRndInteger(15,45)
    }else if(chance_percentage<50) {
        chance_percentage = getRndInteger(0,15)
    }
    
    console.log(chance_percentage)
    return chance_percentage
}

